INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Message', 'en', 11000, 'The Red Cross register of pledges is an online system that allows individuals and corporations to pledge accommodation, goods and services for use in times of crisis. Until now, The Red Cross has been unable to accept donations of goods as we lack the facilities to store them. By using the register of pledges, you are undertaking to provide the goods or services as and when they are needed.', 1, 1, current_date, current_date);
