INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Message', 'fr', 11001, 'Le registre Croix-Rouge des engagements est un système en ligne qui permet aux individus et aux sociétés de engagent hébergement , biens et services pour une utilisation en temps de crise . Jusqu''à présent , La Croix-Rouge a été incapable d''accepter des dons de marchandises que nous manquons les installations pour les stocker . En utilisant le registre des gages , vous vous engagez à fournir les biens ou services comme et quand ils sont nécessaires.', 1, 1, current_date, current_date);
