INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Message', 'de', 11002, 'Das Rote Kreuz Pfandregister ist ein Online- System, das Privatpersonen und Unternehmen , um Unterkunft, Waren und Dienstleistungen für den Einsatz in Krisenzeiten verpfänden können . Bis jetzt hat das Rote Kreuz nicht in der Lage , um Spenden von Waren anzunehmen , da wir nicht über die Einrichtungen , um sie zu speichern. Durch die Verwendung der Pfandregister , werden Sie unternehmen , um die Waren oder Dienstleistungen bereitstellt, und wenn sie gebraucht werden.', 1, 1, current_date, current_date);
